import React from 'react';
import Button from '@material-ui/core/Button';
import img from './images/home1-slider.png';


const Contact = () => {
    return(
        <>
        <div className="row">
        <div className="col-md-1"></div>
        <div className="col-md-10 p-4 pt-5">
        <div className="row">
        <div className="col-md-6 slider pt-lg-0 my-auto d-inline-block order-lg-1 order-xs-2">
            <h1>Grow your Business with <strong>React Solution</strong></h1>
            <p>We are the team of talented developer making websites</p>
            <Button variant="outlined" className="slider_button">
            Get Started
            </Button>
         </div>
        
         <div className="col-md-6 order-lg-2 order-xs-1 d-inline-block">
            <img src={img} className="home-slider-img img-fluid"/>
         </div>
         </div>
         </div>
         <div className="col-md-1"></div>
         </div>
         
        </>
    );
}

export default Contact;
